import React from 'react';

function LT01White() {

  const LT01White = [
    {
      "href": "http://localhost:3000/LT-01-White",
      "title": "LT 01 White",
      "price": 249,
      "imgUrl": "./img/img1.jpg"
    }
  ]

  return (
    <>
    <div className="product">
      <img src="./img/img1.jpg" alt="img" />
      <img src="./img/img1-2.png" alt="img" />
      <img src="./img/img1-3.jpg" alt="img" />
      <img src="./img/img1-4.jpg" alt="img" />
      <img src="./img/img1-5.jpg" alt="img" />
    </div>
    <div className="contentBottom">
      <p className="itemTitle">LT 01 White</p>
      <div className="chooseSize">
       <p>Size - 36</p> 
       <img width="6" src="./img/caret-down.png" alt="caret" />
      </div>
      <div className="addToBag">
      <p>Add to bag</p>
      </div>
    </div>
    </>
  );
}

export default LT01White;
